import { A as emberArray } from 'ember-array/utils';
import isEqual from '../utils/is-equal';

export default function getIndex(array, currentValue, useDeepEqual) {
  let needle = currentValue;

 if (useDeepEqual) {
  needle = emberArray(array).find((object) => {
   return isEqual(object, currentValue, useDeepEqual);
  });
 }

 let index = emberArray(array).indexOf(needle);

 return index >= 0 ? index : null;
}

export default function includes(haystack, ...args) {
  let finder = haystack.includes || haystack.contains;
  return finder.apply(haystack, args);
}

import Ember from 'ember';
const { isEqual: emberIsEqual } = Ember;

export default function isEqual(firstValue, secondValue, useDeepEqual = false) {
  if (useDeepEqual) {
    return JSON.stringify(firstValue) === JSON.stringify(secondValue);
  } else {
    return emberIsEqual(firstValue, secondValue) || emberIsEqual(secondValue, firstValue);
  }
}

import { typeOf } from 'ember-utils';

export default function isObject(val) {
  return typeOf(val) === 'object' || typeOf(val) === 'instance';
}

import { typeOf } from 'ember-utils';
import isObject from './is-object';

function isPromiseLike(obj = {}) {
  return typeOf(obj.then) === 'function' &&
    typeOf(obj.catch) === 'function';
}

export default function isPromise(obj) {
  return isObject(obj) && isPromiseLike(obj);
}

